//
// Point class
//
export class Point // constructor
{
	X : number;
	Y : number;

	constructor(x: number, y: number)
	{
		this.X = x;
		this.Y = y;
	}
}
//
// Rectangle class
//
export function Rectangle(x, y, width, height) // constructor
{
	this.X = x;
	this.Y = y;
	
	this.Width = width;
	this.Height = height;
}
//
// Unistroke class: a unistroke template
//
export class Unistroke // constructor
{
	Name: string;
	Points : Point[];
	Vector : Point[];


	constructor(name: string, points: Point[])
	{
		this.Name = name;
		this.Points = points;

		this.Points = Resample(points, NumPoints);
		var radians = IndicativeAngle(this.Points);
		this.Points = RotateBy(this.Points, -radians);
		this.Points = ScaleTo(this.Points, SquareSize);
		this.Points = TranslateTo(this.Points, Origin);
		this.Vector = Vectorize(this.Points); // for Protractor
	}
}
//
// Result class
//
export function Result(name, score, ms) // constructor
{
	this.Name = name;
	this.Score = score;
	this.Time = ms;
}
